const Table = () => {
  const data = range()

  return (
    <div>
      <table>
        <tbody>
          {data.map((el, i) => {
            return (
              
                <td>{el.day}</td>
              
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
